import Grid from "@mui/material/Grid"
import Typography from "@mui/material/Typography"

const FeaturedPost = () => {
  return (
    <>
			<Grid container>
				<Grid item>
					<Typography variant="h5" component="h3">
						post title goes here
					</Typography>
				</Grid>
			</Grid>
    </>
  );
};

export default FeaturedPost;
